import { Box, Heading, HStack, Image, Spacer } from "@chakra-ui/react";

const Home = () => {
  return (
    <HStack spacing="40%" ml="10">
      <Heading as="h1">the best casting agent</Heading>
      <Box mt="30%">
        <Image
          mt="50%"
          boxSize="500px"
          objectFit="cover"
          src="pana.png"
        ></Image>
      </Box>
    </HStack>
  );
};

export default Home;
